import React from 'react';
import { AppBar, Toolbar, Typography } from '@material-ui/core';
import './NavBar.css'

const NavBar = () => {
    return (
        <div>
            <AppBar position="static">
                <Toolbar>
                    <Typography className="ab" variant="H1">
                        متریال
                    </Typography>
                </Toolbar>
            </AppBar>
        </div>
    )
}

export default NavBar;
